# 暴力解法
class Solution1:
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int

        O(n^2) 复杂度
        """
        maxstr, tmpstr = [], []
        for j in range(len(s)):
            for i in s[j:]:
                if i not in tmpstr:
                    tmpstr.append(i)
                elif i in tmpstr:
                    maxstr = maxstr if len(maxstr) >= len(tmpstr) else tmpstr
                    tmpstr = [i]
            maxstr = maxstr if len(maxstr) > len(tmpstr) else tmpstr
            tmpstr = []
        print(maxstr)
        return len(maxstr)


# 快慢指针
class Solution2:
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int

        O(n) 复杂度
        """
        p1, p2 = 0, 0
        maxlen = 0
        sk = set()
        while p2 < len(s):
            if s[p2] not in sk:
                sk.add(s[p2])
                p2 += 1
                maxlen = max(maxlen, len(sk))
            else:
                start = s.index(s[p2], p1) + 1
                for i in s[p1:start]:
                    sk.remove(i)
                p1 = start
                sk.add(s[p2])
                p2 += 1
        return maxlen


# 快慢指针修改 （readable, slower）
class Solution3:
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int

        O(n) 复杂度
        """
        cut, length = 0, 0
        tmps, used = [], set()

        for i in s:
            if i not in used:
                used.add(i)
                tmps.append(i)
            else:
                cut = tmps.index(i) + 1
                tmps = tmps[cut:]
                tmps.append(i)
                used = set(tmps)
            length = max(length, len(tmps))
        return length


# 伪代码编程法
class Solution4:
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        # 遍历完才可确定谁最长
        # 定义一个变量存放当前最长长度
        # 遍历时存放当前最长结果子串
        # 遇到重复时重新计算当前子串

        # 定义最长结果
        length = 0
        # 定义当前子串
        cur_str = ''
        # 判断重复？使用集合判断
        dup_set = set()
        # 遍历
        for i in s:
            # 如果不重复，当前子串生长
            if i not in dup_set:
                cur_str = ''.join([cur_str, i])
                dup_set.add(i)
            #       如果重复，开始新子串，原始子串和容器比较
            else:
                length = max(length, len(cur_str))
                # 当前子串使用重复字母后的部分加上当前元素
                index = cur_str.index(i)
                cur_str = cur_str[index + 1:] + i
                # 重新生成检验集合
                dup_set = set(cur_str)
        # 遍历完最后一个子串和容器比较
        length = max(length, len(cur_str))

        return length


